Naughty Bookworms - Jessi Palmer
Added: February 24, 2011

Signing up for a new class at college, Jessi shows up and finds Professor Pierce sitting in an empty classroom. Seems she's the only one who signed up for the Real Estate Assessment Business Course. On top of her being the only student, she's already purchased property, and tells him she's not really sure why she's even there. Quizzing his only student on loans and property values, he quickly discovers a petulant young woman, who might just know her stuff, and is starting to get a little flirty. They may be alone for the next hour, but she needs to chill out. Having sex with a student is going to cost him this job, and with his own real estate business in shambles, he needs this teaching gig! Of course, she isn't taking no for answer, and before he can say another word, she's assessing his cock with her mouth!
